import React, { FC, MutableRefObject, useRef } from 'react';
import "./Canvas.css";

interface ViewProps {
  ref: MutableRefObject<null>
}

const View : FC<ViewProps> = (props) => (
  <canvas {...props} />
);

const Canvas : FC = () => {

  const canvasRef = useRef(null);

  return (
    <View ref={canvasRef} />
  );
};

export default Canvas;
